import React from 'react';
import Search_button from "./buttons/search_button";
import Clear_button from "./buttons/clear_button";
import InputWord from "./inputs/input_word";

const InputLabel = () => {
    return (
        <div>
            <Search_button/>
            <InputWord/>
            <Clear_button/>
        </div>
    );
};

export default InputLabel;
